import React from 'react';
import { useNavigate } from 'react-router-dom'; // Import useNavigate
import './HomeWorker.css';
const updateProfileRoutes = require('./routes/updateProfile'); 
function Home() {
  const navigate = useNavigate(); // Initialize useNavigate

  const handleEdit = () => {
    navigate('/edit'); // Navigate to the edit page
  };
  app.use('/api', updateProfileRoutes);
  const handleLogout = () => {
    localStorage.clear();
    window.location = '/';
  };

  return (
    <div className="home-container">
      <div className="home-header">
        <div className="header-left">
          <div className="dropdown">
            <button className="dropbtn">Setting</button>
            <div className="dropdown-content">
              <button onClick={handleEdit}>Edit</button>
              <button onClick={handleLogout}>Log Out</button>
            </div>
          </div>
        </div>
        <div className="header-right">
          <span>WORKER</span>
        </div>
      </div>
      <div className="home-content">
        <div className="buttons-container">
          <button className="home-button">Add unit test</button>
        </div>
      </div>
    </div>
  );
}

export default Home;
